import logo from './logo.svg';
import './App.css';
import {useState,useEffect} from 'react';

function App() {
  const {message,setMessage} = useState('');
  useEffect(()=>{
    fetch("http://localhost3001/api")
    .then((res)=>{res.json()})
    .then((data)=>{setMessage(data.message)});
  },[]);
  return (
    <div className="App">
      <h1>frontend</h1>
      <p></p>
    </div>
  );
}

export default App;
